Since P is inscribed in circle Q, the diameter of Q is equal to the diagonal of P. Using the Pythagorean Theorem, we find that the diagonal of P is $s\sqrt{2}$, so the diameter of Q is $s\sqrt{2}$. Therefore, the circumference of Q is $\pi$ times the diameter, or $s\sqrt{2}\pi = 10\sqrt{2}\pi$. 

The answer is $\boxed{\textbf{(B) }10\sqrt{2}\pi}$.
